import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 九·六辛日甲午时断</p><p>六辛日逢甲午时，暗鬼枭神真可畏；</p><p>若无倚托反劳生，莫道六辛逢马贵。</p><p>辛日甲午时，鬼旺身衰。</p><p>辛用丁为鬼，己为倒食，甲为财。</p><p>甲午木死则神无气，丁己健旺，虽见午为天乙贵，平生反复；纵通旺气，亦贵不永。</p><p>若生火土月，西方运，贵。</p><p>辛丑日甲午时，未申年月，四柱有利害，虽富寿夭。</p><p>通金，虽贵不永。</p><p>辛卯目甲午时，卯月，武贵。</p><p>寅戌，破祖；不然，残夭。</p><p>巳午七、八品贵。</p><p>运同。</p><p>辛巳日甲午时，平。</p><p>寅午戌，官旺，吉。</p><p>申子辰、平常。</p><p>卯戌年，官印双全，公候。</p><p>辛未日甲午时，申子辰，偏官有制，吉。</p><p>丑戌，方面。</p><p>未月。</p><p>贵。</p><p>辛酉日甲午时，春，财旺；夏，官贵，俱吉。</p><p>秋，身强，虽富不永，冬，平常。</p><p>辛亥日甲午时，亥子年月，金水氵亟秀，文学堪夸。</p><p>辰戌丑未、杂气财官，贵显。</p><p>六辛日干时甲午，财神无气不相当；春生木旺财官运，一路滔滔姓字香。</p><p>辛日时临甲午，妻财无气身衰。</p><p>干强火旺为鬼胎，火重金柔炼坏。</p><p>最忌用神伤损，金沈海底生灾。</p><p>无刑无破称心怀，贵重光明广大。</p>",30),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","257卷 九·六辛日甲午时断.html.vue"]]);export{f as default};
